import { Avatar, Grid } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import "./signstyle.css";
import logo from "./image/logo-header.png";
import AccountCircle from "@mui/icons-material/AccountCircle";
import TextField from "@mui/material/TextField";
import LockIcon from '@mui/icons-material/Lock';

export default function Signin() {
  return (
    <Box sx={{ flexGrow: 1 }} className="signBox">
      <Grid container className="signGrid">
        <Grid item xs={8}>
          {/* Logo */}
          <Grid>
            <img src={logo} />
          </Grid>

          {/* Branding */}
          <Grid align="center">
            <h2>Sign In To Waviz</h2>
          </Grid>

          {/* Sign In Options */}

          <Grid container justifyContent="center" marginTop="20">
            <Avatar>f</Avatar>
            <Avatar className="avtarStyle">G+</Avatar>
            <Avatar>in</Avatar>
          </Grid>
          <Grid align="center">
            <p>or use your email account:</p>
          </Grid>

          {/* Main Form */}

          <Grid align='center'>
            <Grid sx={{ display: "flex", alignItems: "flex-end" }}>
              <AccountCircle sx={{ color: "action.active", mr: 1, my: 0.5 }} />
              <TextField
                id="input-with-sx"
                label="Email"
                variant="standard"
              />
            </Grid>
            <Grid align='cenetr' sx={{ display: "flex", alignItems: "flex-end" }}>
              <LockIcon sx={{ color: "action.active", mr: 1, my: 0.5 }} />
              <TextField
                type="password"
                id="input-with-sx"
                label="Password"
                variant="standard"
              />
            </Grid>
          </Grid>
        </Grid>

        {/* Right Div */}

        <Grid item xs={4} className="rightGrid">
          <div>Right</div>
        </Grid>
      </Grid>
    </Box>
  );
}
